import {
    LitElement,
    html,
    css
} from 'lit';
/**
 * TM24 GEMS
 * WEB COMPONENT
 */
export class TMGems extends LitElement {
    static get styles() {
        return css `
      :host,
      #tm-gems {
        display: block;
        position:fixed;
        top:0;
        left:0;
        right:0;
        bottom:0;
        pointer-events:none;
        overflow:hidden;
        z-index:99;
      }
      #tm-gems img{
        position: absolute;
        width: 0px;
        height: auto;
        max-width:180px;
        max-height:180px;
        transform: translateX(-50%) translateY(-50%);
        transition: all 800ms cubic-bezier(0.06, 0.49, 0.02, 1.35);
        transition-property: width, height;
      }
      #tm-gems img.bling {
        transition: all 150ms cubic-bezier(0, 1.21, 0, 4.95);
        opacity: 0.9;
      }
    `;
    }

    static get properties() {
        return {
            pause: {
                attribute: false
            },
            distance: {
                type: Number,
                attribute: 'gem-distance',
            },
            maxGems: {
                type: Number,
                attribute: 'max-gems',
            },
            gemWidth: {
                type: Number,
                attribute: 'gem-width',
            },
            gemMinWidth:{
                type: Number,
                attribute: 'gem-min-width'
            },
            gemDifference: {
                type: Number,
                attribute: 'gem-difference',
            },
            gemDelay: {
                type: Number,
                attribute: 'gem-delay'
            },
            gemLife: {
                type: Number,
                attribute: 'gem-life'
            },
            assets: {
                attribute: false
            },
            _gems: {
                attribute: false,
                state: true
            },
            _sparkles: {
                attribute: false,
                state: true
            },
            _viewport: {
                attribute: false,
                state: true
            }
        };
    }

    constructor() {
        super();
        this.pause = false;
        this.distance = 1.3;
        this.maxGems = 45;
        this.gemWidth = 2.4;
        this.gemMinWidth = 30;
        this.gemDifference = 0.5;
        this.gemDelay = 300;
        this.gemLife = 4000;
        this._gems = {
            active: false,
            asset: 0,
            distance: 0,
            size: 0,
            gems: [],
            quarry: []
        };
        this._viewport = {
            vw: 0,
            vh: 0,
            landscape: false
        }
        this.assets = {
            gems: ["", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", ""],
            bling: ""
        }

        this._resize();

    }

    connectedCallback() {

        super.connectedCallback();
        document.addEventListener('pointerdown', this._startgems);
        document.addEventListener('pointerup', this._stopgems);

        if (this._isTouchDevice()) {
            document.addEventListener('touchend', this._stopgems);
        }

        window.addEventListener('resize', this._resize);

    }
    disconnectedCallback() {
        document.removeEventListener('pointerup', this._stopgems);
        document.removeEventListener('touchend', this._stopgems);
        document.removeEventListener('touchmove', this._drawgemsTouch);
        document.removeEventListener('pointermove', this._drawgemsPointer);
        super.disconnectedCallback();
    }
    get scope() {
        return this.renderRoot?.querySelector('#tm-gems') ?? null;
    }

    _resize = () => {


        let vw = window.innerWidth;
        let vh = window.innerHeight;

        let ratio = vw / vh;

        this._viewport.vw = vw;
        this._viewport.vh = vh;

        if (ratio > 1.5) {

            this._viewport.landscape = true;

        } else {

            this._viewport.landscape = false;

        }

        this._gems.size = this._getGemSize(this.gemWidth);
        this._gems.distance = this._gems.size * this.distance;

    }

    _isTouchDevice() {
        return 'ontouchstart' in window || navigator.maxTouchPoints;
    }

    _getGemSize(gDiff) {

        const gMin = 30;
        const gMax = 90;

        let adjust = 1;

        let d;

        if (this._viewport.landscape) {

            d = this._viewport.vw;

        } else {

            d = this._viewport.vh;
            adjust = 1.8;

        }

        let gSize = Math.abs(Math.min(Math.max(d * gDiff * adjust / 100, gMin), gMax));

        if (gSize < this.gemMinWidth){

            d = this.gemMinWidth / gDiff * 100;
            gSize = Math.abs(Math.min(Math.max(d * gDiff * adjust / 100, gMin), gMax));

        }

        return gSize;

    }




    _startgems = (e) => {

        this.pause = setTimeout(() => {

            this._gems.asset = this._random(0, this.assets.gems.length-1);
            this._gems.active = true;

            if (this._isTouchDevice()) {
                document.addEventListener('touchmove', this._drawgemsTouch);
            } else {
                document.addEventListener('pointermove', this._drawgemsPointer);
            }

        }, this.gemDelay)

    }

    _stopgems = (e) => {

        clearTimeout(this.pause);
        this._gems.active = false;
        document.removeEventListener('touchmove', this._drawgemsTouch);
        document.removeEventListener('pointermove', this._drawgemsPointer);

    }

    _drawgemsTouch = (e) => {

        this._drawgems(e.touches[0].clientX, e.touches[0].clientY);

    }

    _drawgemsPointer = (e) => {

        this._drawgems(e.clientX, e.clientY);

    }

    _drawgems(clientX,clientY){

        // CHECK FOR ADJACENT GEMS

        let comfort = this._comfortZone(clientX, clientY, this._gems.gems, this.distance);

        if (comfort) {

            // CREATE GEM ELEMENT

            let gem = document.createElement('img');
            gem.setAttribute('src', 'data:image/png;base64,' + this.assets.gems[this._gems.asset]);

            let gx = clientX / this._viewport.vw * 100;
            let gy = clientY / this._viewport.vh * 100;

            gem.style.left = gx + "%";
            gem.style.top = gy + "%";

            let gDiff = this._random(100 - 100 * this.gemDifference, 100 + 100 * this.gemDifference) / 100;

            let size = {
                x: clientX,
                y: clientY,
                el: gem,
            }

            // PUSH GEM ELEMENT

            this._gems.gems.push(size);

            this.scope.appendChild(gem);

            setTimeout(() => {

                gem.style.width = this._gems.size * gDiff + "px";

            }, 10);

            // DRAW BLING

            this._drawBling(clientX, clientY, this._gems.size * gDiff);

            if (this._gems.gems.length > this.maxGems) {

                this._gems.gems[0].el.style.width = "0px";
                this._gems.quarry.push(this._gems.gems[0]);
                this._gems.gems.splice(0, 1);

                setTimeout(() => {

                    this.scope.removeChild(this._gems.quarry[0].el);
                    this._gems.quarry.splice(0, 1);

                }, 800)

            }

            // SAY GOODBYE

            this._gemBye(gem);

        }

    }

    _drawBling(x, y, width) {

        let delay = 10;

        for (let i = 0; i <= 2; i++) {

            let bxA = this._random(x - this._gems.size * 0.5, x + this._gems.size * 0.5);
            let byA = this._random(y - this._gems.size * 0.5, y + this._gems.size * 0.5);

            let bx = bxA / this._viewport.vw * 100;
            let by = byA / this._viewport.vh * 100;

            let bw = this._random(width * 0.4, width * 0.8);

            let bling = document.createElement('img');
            bling.setAttribute('src', 'data:image/png;base64,' + this.assets.bling);
            bling.classList.add('bling');
            bling.style.left = bx + "%";
            bling.style.top = by + "%";

            setTimeout(() => {

                bling.style.width = bw + "px";

            }, (200 + delay) * i);

            this.scope.appendChild(bling);

            setTimeout(() => {

                this.scope.removeChild(bling);

            }, (200 + delay + 150) * i)

        }

    }

    _gemBye(gem) {

        setTimeout(() => {

            if (this._gems.gems.length) {

                this._gems.gems[0].el.style.width = "0px";
                this._gems.quarry.push(this._gems.gems[0]);
                this._gems.gems.splice(0, 1);

                setTimeout(() => {

                    this.scope.removeChild(this._gems.quarry[0].el);
                    this._gems.quarry.splice(0, 1);

                }, 800)

            }

        }, this.gemLife)

    }

    _comfortZone(x, y, gems) {

        let comfort = true;

        gems.forEach(gem => {

            if (Math.abs(gem.x - x) <= this._gems.distance && Math.abs(gem.y - y) <= this._gems.distance) {

                comfort = false;

            }

        })

        return comfort;

    }

    _random(min, max) {
        max = Math.floor(max) - 1;
        return Math.floor(Math.random() * (max - min + 1) + min);
    }

    render() {
        return html `
    <section id="tm-gems"></section>
`;
    }
}

window.customElements.define('tm-gems', TMGems);